import React, { useState, useEffect } from 'react';
import { Switch, Route, useHistory } from "react-router-dom"
import axios from "axios";

import { LandingPage } from "./Containers/LandingPage"
import { SearchingPage } from "./Containers/SearchingPage"

export const App = () => {
  const [results, setResults] = useState([]);
  const [searchText, setSearchText] = useState("");

  return (
    <div>
      <Switch>
        <Route exact path="/" render={(props) => <LandingPage searchText={searchText} setSearchText={setSearchText} {...props} />} />
        <Route path="/search" render={(props) => <SearchingPage results={results} {...props} />} />
      </Switch>
    </div>
  );
}
